import React from 'react'
import AdminHeader from '../Layout/AdminHeader'
import { Outlet } from 'react-router-dom'

function AdminLayout() {
  return (
    <>
        <AdminHeader/>
        <Outlet />
    </>
  )
}

export default AdminLayout
